import React, {Component} from 'react';
import './App.css';

class User extends Component{
  constructor(props){
    super(props)
    this.state = {
      name: "Ana Kelly"
    }
  }
}

function App() {
  return (
    <div className="App">
    {this.state.name}
    </div>
  );
}

export default App;
